// \u65F6\u95F4\u590D\u6742\u5EA6O(logN*logN)
// \u6BCF\u6B21\u90FD\u6709\u4E00\u4E2Ahl===hr\u7684\u60C5\u51B5\uFF0C\u5FC5\u6709\u4E00\u8FB9\u7684\u65F6\u95F4\u590D\u6742\u5EA6\u662FLogN
// \u53E6\u4E00\u8FB9while\u5FAA\u73AF\u7684\u65F6\u95F4\u590D\u6742\u5EA6\u662FLogN
/**
 * @param {TreeNode} root
 * @return {number}
 */
var countNodes = function (root) {
  if (root === null) return 0;
  let l = root,
    r = root;
  let hr = 0,
    hl = 0;
  while (l !== null) {
    l = l.left;
    hl++;
  }
  while (r !== null) {
    r = r.right;
    hr++;
  }
  if (hl === hr) {
    return Math.pow(2, hl) - 1;
  } else {
    return 1 + countNodes(root.left) + countNodes(root.right);
  }
};
