var binaryTreePaths = function (root) {
  let path = [];
  let res = [];
  const traverse = (root) => {
    if (root === null) return;

    path.push(root.val);
    if (root.left === null && root.right === null) {
      res.push(path.join("->"));
    }
    root.left && traverse(root.left);
    root.right && traverse(root.right);
    path.pop();
  };
  traverse(root);
  return res;
};
