\u7A7A\u95F4\u590D\u6742\u5EA6O(N)`,paraId:20,tocIndex:34},{value:"\u601D\u8DEF",paraId:0},{value:"\u904D\u5386\u4E8C\u53C9\u6811\uFF0C\u7EDF\u8BA1\u5404\u4E2A\u6570\u5B57\u51FA\u73B0\u7684\u6B21\u6570\uFF08\u4E2D\u5E8F\u904D\u5386\u662F\u6709\u5E8F\u7684\uFF0C\u53EF\u4EE5\u653E\u5728\u4E2D\u5E8F\u904D\u5386\u4F4D\u7F6E\u7EDF\u8BA1\uFF09",paraId:0},{value:"\u7136\u540E\u627E\u51FA\u6700\u5927\u7684\u51FA\u73B0\u6B21\u6570",paraId:0},{value:"\u6700\u540E\u904D\u5386map\uFF0C\u5C06\u51FA\u73B0\u6B21\u6570\u6700\u5927\u7684key\uFF0C\u653E\u8FDBres\u4E2D\u8FD4\u56DE",paraId:0},{value:`/**
 * @param {TreeNode} root
 * @return {number[]}
 */
var findMode = function (root) {
  const map = new Map();
  const traverse = (root) => {
    if (root === null) return;

    traverse(root.left);
    let v = root.val;
    map.set(v, map.has(v) ? map.get(v) + 1 : 1);
    traverse(root.right);
  };
  traverse(root);

  let max = Math.max(...map.values());
  let res = [];
  for (let [k, v] of map) {
    if (v === max) res.push(k);
  }
  return res;
};
`,paraId:0},{value:"508.\u51FA\u73B0\u6B21\u6570\u6700\u591A\u7684\u5B50\u6811\u5143\u7D20\u548C",paraId:0},{value:"medium",paraId:0},{value:"\u601D\u8DEF\u8DDF501\u9898\u7C7B\u4F3C",paraId:21,tocIndex:35},{value:"\u7EDF\u8BA1\u5B50\u6811\u7684\u5143\u7D20\u548C \u51FA\u73B0\u7684\u6B21\u6570\uFF0C\u5B58\u5728map\u4E2D",paraId:0},{value:"\u9700\u8981\u7EDF\u8BA1\u548C\uFF0C\u5728\u540E\u5E8F\u904D\u5386\u66F4\u65B9\u4FBF\u7EDF\u8BA1",paraId:0},{value:"\u7136\u540E\u627E\u51FA\u6700\u5927\u51FA\u73B0\u6B21\u6570maxCount",paraId:0},{value:"\u6700\u540E\u6839\u57FAmaxCount\uFF0C\u627E\u51FA\u5BF9\u5E94\u7684value\uFF0C\u5B58\u5165\u6570\u7EC4\u5E76\u8FD4\u56DE",paraId:0},{value:`/**
 * @param {TreeNode} root
 * @return {number[]}
 */
var findFrequentTreeSum = function (root) {
  const map = new Map();
  const traverse = (root) => {
    if (root === null) return 0;
    const leftSum = traverse(root.left);
    const rightSum = traverse(root.right);
    const sum = leftSum + rightSum + root.val;
    map.set(sum, map.has(sum) ? map.get(sum) + 1 : 1);
    return sum;
  };
  traverse(root);

  let res = [];
  const max = Math.max(...map.values());
  for (const [k, v] of map) {
    if (v === max) res.push(k);
  }
  return res;
};
`,paraId:0},{value:"513.\u627E\u6811\u5DE6\u4E0B\u89D2\u7684\u503C",paraId:0},{value:"medium",paraId:0},{value:"\u6709\u70B9\u50CF\u4E8C\u53C9\u6811\u7684\u6700\u5927\u6DF1\u5EA6\u90A3\u4E00\u9053\u9898",paraId:0},{value:"\u5F53\u7B2C\u4E00\u6B21\u5230\u8FBE\u6700\u5927\u6DF1\u5EA6\u65F6\u5019\uFF0C\u90A3\u9897\u6811\u5C31\u662F\u5DE6\u4E0B\u89D2\u7684\u6811",paraId:0},{value:`/**
 * @param {TreeNode} root
 * @return {number}
 */
var findBottomLeftValue = function (root) {
  let res = 0;
  let level = 0,
    maxLevel = 0;

  const traverse = (root) => {
    if (root === null) return;
    level++;
    if (level > maxLevel) {
      maxLevel = level;
      res = root.val;
    }
    traverse(root.left);
    traverse(root.right);
    level--;
  };
  traverse(root);
  return res;
};
`,paraId:0},{value:"515.\u5728\u6BCF\u4E2A\u6811\u884C\u4E2D\u627E\u6700\u5927\u503C",paraId:0},{value:"medium",paraId:0},{value:"\u601D\u8DEF",paraId:0},{value:"\u5C42\u5E8F\u904D\u5386",paraId:0},{value:"\u904D\u5386\u8FC7\u7A0B\u4E2D\uFF0C\u4FDD\u7559\u6BCF\u5C42\u7684\u503C",paraId:0},{value:"\u8BE5\u5C42\u7ED3\u675F\u540E\uFF0C\u5C06\u8BE5\u5C42\u6700\u5927\u7684\u503C\uFF0C\u653E\u5165res\u4E2D\u8FD4\u56DE",paraId:0},{value:`/**
 * @param {TreeNode} root
 * @return {number[]}
 */
var largestValues = function (root) {
  let res = [];
  if (root === null) return res;
  const q = [root];

  while (q.length) {
    const level = [];
    for (let i = 0, len = q.length; i < len; i++) {
      const node = q.shift();
      level.push(node.val);
      node.left && q.push(node.left);
      node.right && q.push(node.right);
    }
    res.push(Math.max(...level));
  }

  return res;
};
`,paraId:0},{value:"530.\u4E8C\u53C9\u641C\u7D22\u6811\u7684\u6700\u5C0F\u7EDD\u5BF9\u5DEE",paraId:0},{value:"easy",paraId:0},{value:"\u601D\u8DEF",paraId:0},{value:"\u4E2D\u5E8F\u904D\u5386\u662F\u6709\u5E8F\u7684",paraId:0},{value:"\u5728\u4E2D\u5E8F\u904D\u5386\u8FC7\u7A0B\u4E2D\uFF0C\u8BA1\u7B97\u6700\u5C0F\u7684\u5DEE",paraId:0},{value:"\u9700\u8981\u4FDD\u7559\u4E0A\u4E00\u4E2A\u8282\u70B9",paraId:0},{value:`/**
 * @param {TreeNode} root
 * @return {number}
 */
var getMinimumDifference = function (root) {
  let min = Infinity;
  let prev = null;
  const traverse = (root) => {
    if (root === null) return;
    traverse(root.left);
    if (prev !== null) {
      min = Math.min(min, Math.abs(prev.val - root.val));
    }
    prev = root;
    traverse(root.right);
  };
  traverse(root);
  return min;
};
